Here's a Python program that prints out the first 100 prime numbers:
```python
def is_prime(num):
    if num < 2:
        return False
    for i in range(2, int(num**0.5 + 1):
        if num % i == 0:
            return False
    return True

def get_primes(n):
    primes = []
    for i in range(2, n+1):
        if is_prime(i):
            primes.append(i)
    return primes

print("The first 100 prime numbers are:")
for num in get_primes(100):
    print(num)
